import axios from "axios"
import Data from "./Data"
import List from "./List"

export default function TourList() {
    const [isLoading, setIsLoading] = useState(false)
    const [list, setList] = useState([])
    const tourList = async () => {

    }
    useEffect(() => {
        tourList()
    }, [])
    if (isLoading) {
        return(
            <div>Loading...</div>
        )
    }
    if (list.length === 0) {
        return(
            <div className="container d-flex justify-content-center">
                <h1>No tour list available now</h1>
                <button onClick={() => tourList()}>Refresh</button>
            </div>
        )
    }
    return(
        <div className="container d-flex justify-content-center mt-4">
            <div>
            { Data.map((place) => (
                <div className="card shadow mt-3">
                    <div className="card-head">
                        <img src={place.image} />
                    </div>
                    <div className="card-body">
                        <div className="d-flex justify-content-between mt-3">
                            <h5>{place.comment}</h5>
                            <h5 className="text-info">{'$' + place.price}</h5>
                        </div>
                        <p style={{color:'#617d98'}}>{place.about}<button  style={{color:'blue'}}>read more</button></p>
                    </div>
                </div>
            ))}
            </div>
        </div>
    )
}
